import { Container, Row, Col, Button } from "react-bootstrap";
import React, {useContext} from "react";
import { ModeContext } from "./ModeContext";
function Services() {
  const [show, setShow, language, setLanguage]= useContext(ModeContext);
  function handleShow(){
    setShow(true);
  }
  return (
    <div className="Services" id="services">
      <br />
      <center><u><h2 style={{ color: 'white' }}>{language.service.title}</h2></u>
        <hr style={{ color: 'white', width: '100px', height: '2px' }} />
      </center>

      <Container>
        <br /><br />
        {/* Stack the columns on mobile by making one full-width and the other half-width */}
        <Row >
          <Col xs={12} md={6} >
            <center>
              <img src="./img/2.jpg" className="ServicesImg" />
            </center>
          </Col>
          <Col xs={12} md={6} >
            <center>
              <ul style={{direction:'rtl', color:'white' }}>
                <li>
                {language.service[1]}
                </li>
                <li>
                {language.service[2]}
                </li>
                <li>
                {language.service[3]}
                </li>
                <li>
                {language.service[4]}
                </li>
                <li>
                {language.service[5]}
                </li>
                <li>
                {language.service[6]}
                </li>
                <li>
                {language.service[7]}
                </li>
                <li>
                {language.service[8]}
                </li>
                <li>
                {language.service[9]}
                </li>
                <br />
                <li>
                <Button onClick={handleShow}>{language.service.button}</Button>
                </li>
              </ul>
            </center>
          </Col>
        </Row>
      </Container>
    </div>
  );
}
export default Services;
